import React from 'react';
import { Link } from 'react-router-dom';

const RecipeList = () => {
  const recipes = [
    { id: 1, title: 'Butter Chicken' },
    { id: 2, title: 'Paneer Tikka' },
    { id: 3, title: 'Biryani' },
    { id: 4, title: 'Chole Bhature' },
    { id: 5, title: 'Samosa' },
  ];

  return (
    <div>
      <h2>Recipe List</h2>
      <ul>
        {recipes.map((recipe) => (
          <li key={recipe.id}>
            <Link to={`/recipes/${recipe.id}`}>{recipe.title}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default RecipeList;
